# Current floor
floor = 0
# Current input position
pos = 0
# First input position that takes us to the basement
pos_basement = None

# Processing input
for c in input:
  # Increment current position
  pos = pos + 1
  # Increments/Decrement current floor
  if c == '(':
    floor = floor + 1
  else:
    floor = floor - 1
  # Checking if we have reached the basement
  if pos_basement is None and floor == -1:
    pos_basement = pos

# Printing the results
print(f"Part One: {floor}")
print(f"Part Two: {pos_basement}")